import React from "react";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Nav from "./Nav";
import "./Styles.css";
function App() {
  return (
    <Router>
      <Nav />
      <Switch>
        <Route></Route>
        <Route></Route>
        <Route></Route>
        <Route></Route>
      </Switch>
    </Router>
  );
}

export default App;
